import { colRef } from '../firebaseConfig/firebaseConfig'

const Home = () => {

    getDocs(colRef).then((snapshot)=>{
        let books = []
        snapshot.docs.forEach(doc=>{
            books.push({...doc.data(),id:doc.id})
        })
        console.log(books)
    }).catch(err=>{console.log(err)})

    return ( 
        <h1>Prova</h1>
    );
}

export default Home;
